body,
button,
html,
input,
select,
textarea {
    font-family: -apple-system, BlinkMacSystemFont, 'avenir next', avenir, 'helvetica neue', helvetica, ubuntu, roboto, noto, 'segoe ui', arial, sans-serif;
}
.header-logo {
    text-decoration: none;
}
.header-logo .header-logo-default {
    display: none;
}
.header-logo::after {
    content: "Trello";
    font-family: -apple-system, BlinkMacSystemFont, 'avenir next', avenir, 'helvetica neue', helvetica, ubuntu, roboto, noto, 'segoe ui', arial, sans-serif;
    font-size: 17px;
    line-height: 30px;
    color: white;
}

.list-card {
    border-bottom: 0;
    border-radius: 0;
}

.list {
    border-radius: 0;
}

body,
button,
html,
input,
select,
textarea,
body, #page, #hipchat {
    font-family: -apple-system, BlinkMacSystemFont, 'avenir next', avenir, 'helvetica neue', helvetica, ubuntu, roboto, noto, 'segoe ui', arial, sans-serif;
}

body.dark #hipchat .hc-chat-panel .hc-chat-scrollbox {
    background-color: #21222C !important;
}

body.dark #hipchat .hc-left-sidebar-col .hc-sidebar {
    background-color: #21222C !important;
    border-right: 1px solid #21222C;
}

body.dark #hipchat .hc-chat-panel .hc-chat-scrollbox .hc-msg-blue {
    background: #21222C !important;
    border-top-color: transparent;
    color: white;
    opacity: 1;
}

body.dark #hipchat .hc-chat-panel .hc-chat-scrollbox .hc-chat-row {
    border-top-color: transparent;
    color: #aaaaaa;
}

body.dark #hipchat .hc-chat-panel .hc-chat-scrollbox .date-divider span {
    background-color: #21222C;
    color: #aaaaaa;
}

.aui-header {
    background: #21222C;
    border-bottom: 1px solid #21222C;
}

body.dark #hipchat .aui-page-header {
    background-color: #21222C;
    color: #aaaaaa;
    border-bottom-color: #21222C;
}

body.dark #hipchat .hc-left-sidebar-col .hc-sidebar .hc-tab.aui-nav-selected > a {
    background-color: #282A36;
}

body.dark #hipchat .hc-chat-panel .hc-chat-scrollbox .hc-msg-gray {
    background: #21222C;
    border-top-color: #21222C;
    opacity: 1;
}

body.dark #hipchat .hc-chat-panel .hc-chat-scrollbox .atlascard {
    border-color: #282A36;
    background-color: #21222C;
}

body.dark #hipchat .hc-chat-box {
    border-color: #21222C;
    background-color: #21222C;
    border-left: 1px solid #21222C;
}

.hc-left-sidebar-col {
	font-size: 13px;
}

body.dark #hipchat .hc-chat-box .hc-text-input textarea {
    background-color: #282A36;
    color: #aaaaaa;
    border-color: #21222C;
}

body .hc-file-icon, #page .hc-file-icon, #hipchat .hc-file-icon {
    opacity: 0;
}

body.dark #hipchat .hc-chat-box .hc-text-input .smiley-icon {
    opacity: 0;
}

body.dark #hipchat .hc-chat-box form.aui .hc-file-btn {
    background: #333940;
    border-color: #21222C;
    opacity: 0.1;
}

.aui-avatar {
    filter: grayscale(100%);
	opacity: 0.7;
}

body.dark #hipchat .aui-page-header .aui-button, body.dark #hipchat .aui-page-header .aui-button:visited, body.dark #hipchat .aui-page-header a.aui-button {
	border-color: #21222C;
    background: #282A36;
}

body.dark #hipchat .aui-page-header .aui-button .aui-icon {
	opacity: 0.2;
}
